import { POST_ID, GET_ID, GETMY_ID } from './types'
import axios from 'axios'
import { useEffect } from 'react'
const token = window.localStorage.getItem('token')
export const getId = async () => (dispatch) => {
    if (token !== null && token !== '') {
        axios
            .get('https://jobs-xmmtw.ondigitalocean.app/login', {
                headers: {
                    authorization: token,
                },
            })
            .then((UserId) => {
                dispatch({ type: GET_ID, payload: UserId.data })
                axios
                    .get(
                        `https://jobs-xmmtw.ondigitalocean.app/player/{ _id: ${UserId._id}, __v: 0 }`,
                        {
                            headers: {
                                authorization: token,
                            },
                        }
                    )
                    .then((res) => {
                        dispatch({ type: GETMY_ID, payload: res.data })
                    })
            })
            .catch((error) => {
                window.localStorage.removeItem('token')
            })
    }
}
